import {
    Route,
    BrowserRouter as Router,
    Routes
} from "react-router-dom";


import ApplicantDashboard from './pages/dashboard/ApplicantDashboard';
import Login from './pages/login/Login';
import Register from './pages/register/Register';

//toast config
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import CreateJobPage from './pages/create_job/CreateJob';
import EmployerDashboardPage from './pages/dashboard/EmployerDashboard';

function App() {
    return (
        <Router>
            <ToastContainer />
            <Routes>
                <Route path='/login' element={<Login />} />
                <Route path='/register' element={<Register />} />
                <Route path='/applicant/dashboard' element={<Applicant />} />
                <Route path='/applicant/update_profile' element={<ApplicantDashboard />} />
                <Route path='/employer/dashboard' element={<EmployerDashboardPage />} /><Route path='/employer/dashboard' element={<EmployerDashboardPage />} />
                <Route path='/employer/create_job' element={<CreateJobPage />} />
            </Routes>
        </Router>
    )
}
export default App;
